import {Link} from '../routes'

const Nav = () => (
    <nav className="navbar navbar-expand-md fixed-top  white-color">
        <style jsx>{`
            // background-color: white;
            // .nav-item {
            //   padding: 7px 7px;
            // } 
            // a{
            //     color:#212529 ;
            // }
            // .btn-blue{
            //     color: white;
            // }
        `}</style>
        <div className="container">
            <Link route="home">
                <a className="navbar-brand" href="#">Bedrijfsnaam</a>
            </Link>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarCollapse" aria-controls="navbarCollapse" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarCollapse">
                <ul className="navbar-nav ml-auto">
                    <li className="nav-item active">
                        <Link route="home">
                            <a className="nav-link">Home</a>
                        </Link>
                    </li>
                    <li className="nav-item dropdown">
                        <a className="nav-link dropdown-toggle" href="#" id="navbarDropdownMenuLink" role="button"
                           data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            Diensten
                        </a>
                        <div className="dropdown-menu dropdown-primary" aria-labelledby="navbarDropdownMenuLink">
                            <Link route="services.webshops">
                                <a className="dropdown-item">Webshops</a>
                            </Link>
                            <Link route="services.websites">
                                <a className="dropdown-item">Websites</a>
                            </Link>
                            <Link route="services.web-hosting">
                                <a className="dropdown-item">Web Hosting</a>
                            </Link>
                            <Link route="services.websoftware">
                                <a className="dropdown-item">Websoftware</a>
                            </Link>
                            <Link route="services.content-ontwikkeling">
                                <a className="dropdown-item">Content Ontwikkeling</a>
                            </Link>
                            <Link route="services.internet-marketing">
                                <a className="dropdown-item">Internet Marketing</a>
                            </Link>
                        </div>
                    </li>
                    {/*<li className="nav-item">*/}
                    {/*    <Link route="category.index">*/}
                    {/*        <a className="nav-link">Referenties</a>*/}
                    {/*    </Link>*/}
                    {/*</li>*/}
                    {/*<li className="nav-item">*/}
                    {/*    <Link route="category.index">*/}
                    {/*        <a className="nav-link">Support</a>*/}
                    {/*    </Link>*/}
                    {/*</li>*/}
                    <li className="nav-item">
                        <Link route="over-ons">
                            <a className="nav-link">Over Ons</a>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link route="contact">
                            <a className="nav-link">Contact</a>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link route="offerte-aanvraag">
                            <a className="nav-link blue-gradient btn btn-default btn-sm btn-blue">Offerte Aanvraag</a>
                        </Link>
                    </li>
                    <li className="nav-item">
                        <a className="nav-link blue-gradient btn btn-default btn-sm btn-blue" href="tel:0621651053">+31 (06) 21651053</a>
                    </li>
                </ul>
            </div>
        </div>
    </nav>
)

export default Nav
